De onde vêm os crânios alongados? O volume dos "crânios de Paracas" era 25% maior que a média, e o cérebro era 60% mais pesado. Isso significa que a forma dos crânios de Paracas não é resultado de uma deformação deliberada dos ossos. 
A opção "mutação aleatória" também é excluída. Afinal, mais de 300 desses crânios foram encontrados no sul do Peru. Crânios alongados de forma não natural muitas vezes chegavam aos arqueólogos. Eles foram encontrados no México, Egito, Malta, Síria, norte do Iraque.

